import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import SignalsContainer from '../components/SignalsContainer';
import Header from '../components/Header';
import LPage from '../screens/LPage';
import Login from '../screens/LoginScreen';
import MaintenancePage from '../components/MaintenancePage';

const ProtectedRoute = ({ children, signals }) => {
  const token = localStorage.getItem('token');
  if (!token) {
    return <Navigate to="/login" />;
  }
  return (
    <>
      <Header signals={signals || []} />
      {children}
    </>
  );
};

const AppRoutes = ({ signals }) => {
  return (
    <React.Suspense fallback={<div>Carregando...</div>}>
      <Routes>
        <Route path="/" element={<LPage />} />
        <Route path="/login" element={<Login />} />
        <Route 
          path="/signals" 
          element={
            <ProtectedRoute signals={signals}>
              <SignalsContainer signals={signals} />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/dashboard" 
          element={
            <ProtectedRoute signals={signals}>
              <MaintenancePage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/settings" 
          element={
            <ProtectedRoute signals={signals}>
              <MaintenancePage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/support" 
          element={
            <ProtectedRoute signals={signals}>
              <MaintenancePage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/profile" 
          element={
            <ProtectedRoute signals={signals}>
              <MaintenancePage />
            </ProtectedRoute>
          } 
        />
      </Routes>
    </React.Suspense>
  );
};

export default AppRoutes;
